    footer .footer-content .payment-types .payment-logo img {
      height: 24px;
      opacity: 1;
      transition: opacity 0.7s ease;
      margin: 0 !important
    }

    footer .footer-content .payment-types .payment-logo img:nth-of-type(2),
    footer .footer-content .providers .payment-logo img:nth-of-type(2) {
      position: absolute;
      z-index: 1;
      left: 0;
      top: 0;
      opacity: 0
    }

    footer .footer-content .payment-types .payment-logo:hover img:nth-of-type(1),
    footer .footer-content .providers .payment-logo:hover img:nth-of-type(1) {
      opacity: 0
    }

    footer .footer-content .payment-types .payment-logo:hover img:nth-of-type(2),
    footer .footer-content .providers .payment-logo:hover img:nth-of-type(2) {
      opacity: 1
    }

    footer .footer-content .providers {
      border-top: none;
      margin: 0 0 0 0;
      height: auto;
      padding: 20px 0 0
